import React from "react";

import Header from "./Header";
import Footer from "./Footer";


function App() {
  return (
    <>
      <Header />
      <i>
         <img class="logo" src="/images/mesha-logo.png" /></i>
      <Footer />
    </>
  );
}

export default App;
